Tony, a convict released from prison is ready to regain his power, wealth and appetite for women. He was the big shot in Cuba, but in Miami, he's no one. He's craving the luxurious lifestyle and the money to make girls do anything for him. As time passes and with each scandalous action, he becomes the head mobster in town, gaining the sexiest and most cum hungry trophy wife, Nikki Benz. He now owns Miami, and with power, his wife and Dani Daniels please him to optimal pleasure! His new life is thrilling but everyone including the Feds is trying to take him down. Featuring A-list cast members including Nikki Benz, Julia Ann, Keisha Grey, Natalia Starr, Dahlia Sky, Dani Daniels and Sarah Jessie, and seven hardcore sex scenes.
